inline cFontPtr NEW_CFONTCALIBRI24()
{
    cImage *img = new cImage();
    cLoadPNG(img, CFONTCALIBRI24_BYTEARRAY, sizeof(CFONTCALIBRI24_BYTEARRAY));

    cFontPtr font = cFont::create();
    font->m_charset.m_base       = CFONTCALIBRI24_CHARSET_BASE;
    font->m_charset.m_lineHeight = CFONTCALIBRI24_CHARSET_LINEHEIGHT;
    font->m_charset.m_width      = CFONTCALIBRI24_WIDTH;
    font->m_charset.m_height     = CFONTCALIBRI24_HEIGHT;
    font->m_charset.m_pages      = CFONTCALIBRI24_CHARSET_PAGES;
    for (int i=0; i<256; i++)
    {
        font->m_charset.m_chars[i].m_x        = CFONTCALIBRI24_CHARSET[8*i  ];
        font->m_charset.m_chars[i].m_y        = CFONTCALIBRI24_CHARSET[8*i+1];
        font->m_charset.m_chars[i].m_width    = CFONTCALIBRI24_CHARSET[8*i+2];
        font->m_charset.m_chars[i].m_height   = CFONTCALIBRI24_CHARSET[8*i+3];
        font->m_charset.m_chars[i].m_xOffset  = CFONTCALIBRI24_CHARSET[8*i+4];
        font->m_charset.m_chars[i].m_yOffset  = CFONTCALIBRI24_CHARSET[8*i+5];
        font->m_charset.m_chars[i].m_xAdvance = CFONTCALIBRI24_CHARSET[8*i+6];
        font->m_charset.m_chars[i].m_page     = CFONTCALIBRI24_CHARSET[8*i+7];
    }
    font->m_charset.preProcess();

    font->m_texture->setImage(std::shared_ptr<cImage>(img));

    return (font);
}


